        // If do not need to wait for all players, return true.
        if (!stage.waitToStart) {
            return true;
        }

        // If any player is not ready, return false.
        for (let p in this.players) {
            let player = this.players[p];
            if (!player.isReady(stage.indexInApp())) {
                return false;
            }
        }

        return true;

    }

