            return false;
        }

        // If do not need to wait for all players, return true.
        if (!stage.waitToEnd) {
            return true;
        }

        // If any player is not finished playing, return false.
        for (let p in this.players) {
            let player = this.players[p];
            if (!player.isFinished()) {
                return false;
            }
        }

        // Otherwise, return true.
        return true;
